import React from 'react'
import {Col,Row} from 'react'
import products from '../products.js'
const HomeScreen = () => {
  return (
    <>
    <h>Latest products</h>
    console.log({products});
    <Row>
     
       {
        

        products.map((product)=>
        (
           <Col sm={12} md={6} lg={4} xl={3}>
            <h2>{product.name}</h2>
           </Col>
        )
        )
       } 
     
    </Row>
    </>
    
  )
}

export default HomeScreen
